import React from 'react';
import NextCard from './NextCard';
import './CardItem.css';


function CardItem(props) {
  return (
    <>
      <h2>{props.number}</h2>
      <div className='box'>
        <p>{props.details}</p>
      </div>
    </>
  )
}

export default CardItem;
